import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; 
import Tcwelcome from './training center/tcwelcome'; 
import Tcform1 from './training center/tcform1'; 
import Tcform2 from './training center/tcform2'; 
import Startlearner from './startlearner'; 
import Learner1 from './learner1';
import Learner2 from './learner2';




const App = () => {
  return (

    <Router>
      <Routes> 

        <Route path="/" element={<Startlearner/>} />

        <Route path="learner1" element={<Learner1/>} /> 
        <Route path="learner2" element={<Learner2/>} /> 

        <Route path="/training center/tcwelcome" element={<Tcwelcome/>} />
        <Route path="/training center/tcform1" element={<Tcform1 />} />
        <Route path="/training center/tcform2" element={<Tcform2 />} />
      </Routes>
    </Router> 


  );
}

export default App;
